// 交互
{
	var selected = 4320;
	var hour = 12, minute = 0, second = 0;

	var tipBox = d3.select("#chart2")
		.append("div")
		.style("border","1px solid black")
		.style("margin","0px")
		.style("background-color","#eee");


	var ticking = false;


	tipBox.append("p").html("时间：<span id='time'>00:00:00</span>");
	tipBox.append("p").html("流量：<span id='count'>0</span>");
	tipBox.append("p").html("平均车速：<span id='speed'>no record</span>");

	d3.select("#chart3").append("button")
					.attr("type","button")
					.attr("class","btn btn-default")
					.html("自动播放")
					.style("margin","6px 0px")
					.attr("onclick","play()");

	d3.select("#chart3").append("div")
					.html('<p>最大热度：</p>\
					<p class="align-right">\
						<button type="button" class="btn btn-default smallbtn" id="adj1L">-</button>\
						<prep id="label1">12</prep>\
						<button type="button" class="btn btn-default smallbtn" id="adj1R">+</button>\
					</p>\
					<div id="progress1" class="progress">\
						<div id="strip1" class="progress-bar" role="progressbar" aria-valuenow="60" \
							aria-valuemin="0" aria-valuemax="100" style="width: 66.67%;">\
						</div>\
					</div>');

	var bar1 = d3.select('#progress1');
	var stp1 = d3.select('#strip1');
	var label1 = d3.select('#label1');

	var maxCount = 12;

	d3.select('#adj1L').on('click', function() {
		stp1.transition()
			.duration(200)
			.style("width", function() {
				var num = parseInt(d3.select('#label1').html());
				if (num>1)
					num -= 1;
				label1.html(num);
				maxCount = num;
				return num*100/18+"%";
			});

		redraw(selected);
	});

	d3.select('#adj1R').on('click', function() {
		stp1.transition()
			.duration(200)
			.style("width", function() {
				var num = parseInt(d3.select('#label1').html());
				if (num<18)
					num += 1;
				label1.html(num);
				maxCount = num;
				return num*100/18+"%";
			});

		redraw(selected);
	});


	function play() {
		ticking = !ticking;
	}
}

